description:
Verenigde Staten
Familie / Animatie
92 minuten

geregisseerd door Ash Brannon, John Lasseter en Lee Unkrich
met de stemmen van Tom Hanks, Tim Allen en Joan Cusack

Cowboy-pop Woody en speelgoed-astronaut Buzz zijn terug. Woody blijkt veel geld waard te zijn als verzamelobject, en wordt gestolen door een speelgoedverzamelaar. Buzz en het andere speelgoed van de jonge Andy proberen hem te redden.

